import CalendarModule from './components/CalendarModule/CalendarModule';
import MainWrapper from './components/UI/MainWrapper';
import Ucenici from './components/UI/Pages/Ucenici/Ucenici';
import './App.css'
import { Route } from 'react-router';
function App() {
  return (

        <MainWrapper>
      <Route path='/'>
      <CalendarModule/>
      </Route>
      <Route path='/ucenici'>
      <Ucenici/>
      </Route>
      </MainWrapper>

  );
}

export default App;
